setTimeout(() => {
let i = 0;
rideDataClean.forEach(data => {
  let sourceName = `line${i}`;
  sourceNameList.push(sourceName);
  mapMan.doAction('addGeoJson', {
        sourceId: sourceName,
        layerStyles:{
            type:'line',
            layout: {
            'line-join': 'round',
            'line-cap': 'round'
            },
            paint: {
            'line-color': colors[i],
            'line-width': 5
            }
        },
        geojson: data
    })
  i++;
  }
);
}, "2000");





